 ["[DEPRECATED] 希尔斯布莱德之战"]={
  ["Kill 6 Hillsbrad Farmhands, 6 Hillsbrad Farmers, Farmer Ray and Farmer Getz and report back to Darthalia in Tarren Mill."]={178,1062068898},
  ["Kill 15 Hillsbrad Peasants and report back to Darthalia in Tarren Mill."]={178,3154992778},
  ["Kill Blacksmith Verringtan and 4 Hillsbrad Apprentice Blacksmiths.\n\nRetrieve a shipment of iron and report back to Darthalia in Tarren Mill."]={178,1269184218},
  ["Kill Magistrate Burnside and 4 Hillsbrad Councilmen.  Destroy the Hillsbrad Proclamation.  Steal the Hillsbrad Town Registry.  Report back to Darthalia in Tarren Mill afterwards."]={178,1215733186},
